column8:
美しいグラデーションでソフトな風合いのふんわりリリヤーン。
<br>
ナチュラルなメランジ調のグラデーションは、段染ではなくトップ染を多数使った特殊な製法により生みだされています。
<br>
やわらかなウールの表面感と中を通るナイロンリリヤーンの光沢感が、とても上品な表情を作っています。
<br>
ふっくらとした編み上がりでとても軽く、温もりをたっぷりと感じられる一着となります。
<br><br>

◆仕立：1玉25g巻（約75m）
<br>
◆構成：ウール84％、ナイロン16％
<br>
◆使用針：棒針9～11号、かぎ針 7/0～8/0号<br>
※婦人用プルオーバー：10玉

<br><br>

※見本画像と現物の色が多少異なる場合がございます。<br>
※人気商品、人気色、シーズンの終盤は売り切れが予想されます。<br>
※ご注文が確定しても、タイミングにより売り切れてしまう場合がございますのでご了承下さい。<br><br>

【特典】<br>
こちらの毛糸をご購入のお客様限定編み図をプレゼント！<br>
ご希望のお客様は、ご注文の際「ご要望欄」へ<br>
編み図番号「S4-5171　または　S4-8071」希望の旨ご記入下さい。<br><br>
<p>※メーカー希望小売価格はメーカーサイトに基づいて掲載しています。</p><style type="text/css">
