なめらかなタッチで味わうヘアリー感、少し太めで編みやすい定番モヘヤ糸。<br>
キッドモヘヤとベビーアルパカをブレンドし、ぬめり感のあるやさしい風合いを作っています。<br>
太い針で編めるので仕上がりが速いのもうれしいポイントです。<br>
少し抑えた起毛感で程良いボリュームに編み上がり、とても軽い着心地です。<br><br>

◆仕立：1玉30g巻（約88m）
<br>
◆構成：モヘヤ30％（キッドモヘヤ）、アルパカ10％（ベビーアルパカ）、アクリル60％
<br>
◆使用針：棒針9～10号、かぎ針 7/0～8/0号<br><br>

※婦人用プルオーバー：8玉<br><br>

