ふっくらとした糸面が懐かしいようなかわいらしさで、秋冬ならではのカジュアルなコーディネートにぴったり。<br>
小物からウェアまで、年齢問わず大活躍です！<br><br>

◆仕立：1玉50g巻（約44m）<br>
◆構成：ウール100％<br>
